import React, { useState } from "react";

import { useGetPokemonByNameQuery } from "../store/pokemon";
import { Questionaire } from "./Questionaire";
export const QuestionaireScreen = ({ difficultyValue, amountValue }) => {
  const [questionsData, setQuestionsData] = useState([]);
  const [currentQuestionIndex, setCurrentQuestionIndex] = useState(0);

  const { data, error, isLoading } = useGetPokemonByNameQuery(
    difficultyValue,
    amountValue
  );

  console.log("data", data);

  data?.results?.length &&
    !questionsData?.length &&
    setQuestionsData(data?.results);
  return (
    <div>
      {isLoading ? (
        <div>...Loading</div>
      ) : (
        //TODO: delete else code and add insted of it a component with questionsData props
        questionsData?.length && (
          <Questionaire
            currentQuestionIndex={currentQuestionIndex}
            setCurrentQuestionIndex={setCurrentQuestionIndex}
            data={questionsData[currentQuestionIndex]}
          />
        )
      )}
      {error && <div>Error: {error}</div>}
    </div>
  );
};
